function ChallengeCard() {
    const challenges = [
        "Wiki Race", "Unique Hunt (monster)", "Unique Hunt (clue scroll)", "Red Click Race",
        "Inventory Puzzle", "Item Hunt", "Location Guesser", "OSRS Trivia", "Resource Rush", "Boss Speedrun"
    ];
    return (
        <div className="ChallengeCard-container">
            <ul style={{ listStyle: "none", padding: 0, margin: 0 }}>
                {challenges.map((challenge, idx) => (
                    <li key={idx}>
                        <label>
                            <input type="checkbox" />
                            {challenge}
                        </label>
                    </li>
                ))}
            </ul>
        </div>
    );
}

function LengthCard() {
    const Lengths = [
        "1 Race", "2 Races", "3 Races", "30 Minutes", "1 Hour", "2 Hours", "3 Hours", "1 Day", "1 Week", "1 Month"
    ];
    return (
        <div className="ChallengeCard-container">
            <ul style={{ listStyle: "none", padding: 0, margin: 0 }}>
                {challenges.map((challenge, idx) => (
                    <li key={idx}>
                        <label>
                            <input type="checkbox" />
                            {challenge}
                        </label>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default ChallengeCard;
